import "./App.scss";
import Head from "./Components/head/Head";
import Head2 from "./Components/head2/Head2";
import ShipNPay from "./Components/shipNpay/ShipNPay";
import Payment from "./Components/paymentMethod/Payment";
import Cart from "./Components/yourCart/Cart";
import Footer from "./Components/footer/Footer";
import { Helmet } from "react-helmet";

const myHtml =
  '<form><script src="https://checkout.razorpay.com/v1/payment-button.js" data-payment_button_id="pl_IXqYazgkI3FzdY" async> </script> </form>';

function App() {
  return (
    <div className="App">
      <Head />
      <Head2 />
      <div className="MainDisplay">
        <ShipNPay />
        <Payment />
        <Cart />
      </div>
      <Footer />
      <form>
        <Helmet>
          <script
            src="https://checkout.razorpay.com/v1/payment-button.js"
            data-payment_button_id="pl_IXqYazgkI3FzdY"
            async
          ></script>
        </Helmet>
      </form>
    </div>
  );
}

export default App;
